import React, { useState } from 'react';
import PropTypes from 'prop-types';
import { useNavigate } from 'react-router-dom';
import LeftBar from '../../component/leftbar/leftbar';
import { makeStyles } from '@material-ui/core/styles';
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Button,
  AppBar,
  Tabs,
  Tab,
  Box,
  Menu,
  MenuItem
} from '@material-ui/core';
import './myprograme.css';

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    backgroundColor: theme.palette.background.paper,
  },
}));

function TabPanel(props) {
  const { children, value, index, ...other } = props;

  return (
    <div
      role="tabpanel"
      hidden={value !== index}
      id={`simple-tabpanel-${index}`}
      aria-labelledby={`simple-tab-${index}`}
      {...other}
    >
      {value === index && (
        <Box p={3}>
          {children}
        </Box>
      )}
    </div>
  );
}

TabPanel.propTypes = {
  children: PropTypes.node,
  index: PropTypes.any.isRequired,
  value: PropTypes.any.isRequired,
};

function Myprograme() {
  const classes = useStyles();
  const [anchorEl, setAnchorEl] = useState(null);
  const [value, setValue] = useState(0);
  const [value2, setValue2] = useState(0);
  const navigate = useNavigate();

  const handleClick = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleClose = () => {
    setAnchorEl(null);
  };

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  const handleChange2 = (event, newValue) => {
    setValue2(newValue);
  };

  // 模拟的学生模块列表数据
  const studentModules = [
    { id: 1, module: 'Mathematics', startTime: '9:00 AM', endTime: '11:00 AM', grade: 'A' },
    { id: 2, module: 'Physics', startTime: '1:00 PM', endTime: '3:00 PM', grade: 'B' },
    { id: 3, module: 'History', startTime: '10:00 AM', endTime: '12:00 PM', grade: 'C' },
    { id: 4, module: 'Computer Science', startTime: '2:00 PM', endTime: '4:00 PM', grade: 'A' },
  ];

  return (
    <div className='container' id='MyPrograme'>
      <div className='leftbox'>
        <LeftBar tabNav="MyPrograme" />
      </div>
      <div className='maincenter'>
        <AppBar position="static">
          <Paper square>
            <Tabs
              value={value}
              onChange={handleChange}
              indicatorColor="secondary"
              textColor="secondary"
            >
              <Tab label="Year 1" />
              <Tab label="Year 2" />
              <Tab label="Year 3" />
              <Tab label="Year 4" />
            </Tabs>
          </Paper>
        </AppBar>

        <TabPanel value={value} index={0}>
          <div className='tabbox'>
            <TableContainer className='tablebox'>
              <Table aria-label="simple table">
                <TableHead>
                  <TableRow>
                    <TableCell align="center">ID</TableCell>
                    <TableCell align="center">Module Name</TableCell>
                    <TableCell align="center">Start Time</TableCell>
                    <TableCell align="center">End Time</TableCell>
                    <TableCell align="center">Grade</TableCell>
                    <TableCell align="center">Operation</TableCell>
                  </TableRow>
                </TableHead>
                <TableBody>
                  {studentModules.map((module) => (
                    <TableRow key={module.id}>
                      <TableCell align="center">{module.id}</TableCell>
                      <TableCell align="center">{module.module}</TableCell>
                      <TableCell align="center">{module.startTime}</TableCell>
                      <TableCell align="center">{module.endTime}</TableCell>
                      <TableCell align="center">{module.grade}</TableCell>
                      <TableCell align="center">
                        <Button
                          variant="contained"
                          color="primary"
                          aria-controls="simple-menu"
                          aria-haspopup="true"
                          onClick={handleClick}
                        >
                          Actions
                        </Button>
                      </TableCell>
                    </TableRow>
                  ))}
                </TableBody>
              </Table>
            </TableContainer>
          </div>
        </TabPanel>

        {/* Add TabPanel for Year 2 */}
        {/* Add TabPanels for Year 3 and Year 4 */}
      </div>
      <Menu
        id="simple-menu"
        anchorEl={anchorEl}
        keepMounted
        open={Boolean(anchorEl)}
        onClose={handleClose}
      >
        <MenuItem onClick={handleClose}>Withdraw</MenuItem>
        <MenuItem onClick={handleClose}>Suspend</MenuItem>
        <MenuItem onClick={handleClose}>Enroll</MenuItem>
      </Menu>
    </div>
  );
}

export default Myprograme;
